import './App.css';
import pro_pic from './img/profile_pic2.jpg';
import React, { Component } from "react";
import ReactRoundedImage from "react-rounded-image";

function AboutMe() {
  return (
    <div className="wrapper">
        <img src={pro_pic} alt="profile pic" className="profile_pic" />
        <p className="about_me">
        I am an incoming PhD student in computer science at Carnegie Mellon University. <br /><br />

        In Spring 2021, I completed my undergraduate at the University of Kansas where I 
        double-majored in computer science and mathematics, and minored in visual arts (emphasis 
        in painting). While there, I was a research assistant under the guidance of Dr. 
        Suzanne Shontz in scientific computing. <br /><br />

        I am broadly interested in solving problems at the interface of mathematics and 
        computer science. My current research interests include:
        <ul  margin= "1em 0" padding= "0 0 0 1em">
          <li margin= "1em 0">type theory</li>
          <li margin= "1em 0">language design</li>
          <li margin= "1em 0">quantitative program analysis</li>
        </ul>
        </p>

        <div>
        {/* <ReactRoundedImage 
          className="profile_pic"
          image={pro_pic}
          roundedColor="#321124"
          imageWidth="300"
          imageHeight="300"
        />
        <p>mdotzel [at] andrew [dot] cmu [dot] edu</p> */}
      </div>
        
      
    </div>
  );
}

export default AboutMe;
